import axios from "axios";
import React from "react";

const SSD_API_BASE_URL = "http://localhost:9090/ssd/add";


export default function SsdService(){

const [ssd, setSsd]= React.useState(null);

React.useEffect(() => {
    axios.get("${SSD_API_BASE_URL}/1").then((response) =>{
setSsd(response.data);
    });
},[]);

function addSsd(){
    axios.post(SSD_API_BASE_URL,{
        brand:'',
        model:'',
        serialNumber:'',
        size:'',
        purcaseDate:'',
        purchasePrice:'',
        arrivalDate:''

    }).then((response)=>{
        setSsd(response.data);
    });
}
if(!ssd) return "No post, erro."

return(
     <div>
      <h1>{ssd.brand}</h1>
      <p>{ssd.model}</p>
      <button onClick={addSsd}>Create Post</button>
    </div>
);
}
